ERROR - 2021-08-20 17:16:10 --> Query error: Column 'posted_by' cannot be null - Invalid query: INSERT INTO `community` (`title`, `body`, `posted_by`, `category`, `banner`, `type`, `created_time`, `created_date`) VALUES ('Meeting-People-and-Making-Connections', '<p class=\"p1\" style=\"margin: 0cm; font-size: 13pt; font-family: \'.AppleSystemUIFont\', serif; -webkit-text-size-adjust: auto;\"><span class=\"s1\" style=\"font-family: \'.SFUI-Regular\', serif;\">Most of you can vouch for this; that as you grow older, as you leave university behind and arrive into the world of work, you disconnect from former friends and past lovers.</span></p>\r\n<p class=\"p2\" style=\"margin: 0cm; font-size: 13pt; font-family: \'.AppleSystemUIFont\', serif; -webkit-text-size-adjust: auto;\">&nbsp;</p>\r\n<p class=\"p1\" style=\"margin: 0cm; font-size: 13pt; font-family: \'.AppleSystemUIFont\', serif; -webkit-text-size-adjust: auto;\"><span class=\"s1\" style=\"font-family: \'.SFUI-Regular\', serif;\">Your world is still bright and fosters joy because you also connect with new friends and lovers in the next chapter of life.</span></p>\r\n<p class=\"p2\" style=\"margin: 0cm; font-size: 13pt; font-family: \'.AppleSystemUIFont\', serif; -webkit-text-size-adjust: auto;\">&nbsp;</p>\r\n<p class=\"p1\" style=\"margin: 0cm; font-size: 13pt; font-family: \'.AppleSystemUIFont\', serif; -webkit-text-size-adjust: auto;\"><span class=\"s1\" style=\"font-family: \'.SFUI-Regular\', serif;\">It&rsquo;s true, people come and go, and only the special ones stay. But life can be different. Life ought to be different. <br /></span></p>\r\n<p class=\"p1\" style=\"margin: 0cm; font-size: 13pt; font-family: \'.AppleSystemUIFont\', serif; -webkit-text-size-adjust: auto;\">&nbsp;</p>\r\n<p class=\"p1\" style=\"margin: 0cm; font-size: 13pt; font-family: \'.AppleSystemUIFont\', serif; -webkit-text-size-adjust: auto;\"><span class=\"s1\" style=\"font-family: \'.SFUI-Regular\', serif;\">The question you have to ask yourself is this: who is the one disassociating from others, you or them? If it is you, then it is your burden to rekindle the connection, if it is them, then it is their burden.</span></p>\r\n<p class=\"p2\" style=\"margin: 0cm; font-size: 13pt; font-family: \'.AppleSystemUIFont\', serif; -webkit-text-size-adjust: auto;\">&nbsp;</p>\r\n<p class=\"p1\" style=\"margin: 0cm; font-size: 13pt; font-family: \'.AppleSystemUIFont\', serif; -webkit-text-size-adjust: auto;\"><span class=\"s1\" style=\"font-family: \'.SFUI-Regular\', serif;\">Naturally though, you build connections with people because life without connections is no life at all.</span></p>\r\n<p class=\"p2\" style=\"margin: 0cm; font-size: 13pt; font-family: \'.AppleSystemUIFont\', serif; -webkit-text-size-adjust: auto;\">&nbsp;</p>\r\n<p class=\"p1\" style=\"margin: 0cm; font-size: 13pt; font-family: \'.AppleSystemUIFont\', serif; -webkit-text-size-adjust: auto;\"><span class=\"s1\" style=\"font-family: \'.SFUI-Regular\', serif;\">There are only a handful if not fewer connections you still have from school or university, and those people are here for life. </span></p>\r\n<p class=\"p1\" style=\"margin: 0cm; font-size: 13pt; font-family: \'.AppleSystemUIFont\', serif; -webkit-text-size-adjust: auto;\">&nbsp;</p>\r\n<p class=\"p1\" style=\"margin: 0cm; font-size: 13pt; font-family: \'.AppleSystemUIFont\', serif; -webkit-text-size-adjust: auto;\"><span class=\"s1\" style=\"font-family: \'.SFUI-Regular\', serif;\">You may rarely speak to each other but when you do, it&rsquo;s</span><span class=\"apple-converted-space\"><span style=\"font-family: \'.SFUI-Regular\', serif;\">&nbsp;</span></span><span class=\"s1\" style=\"font-family: \'.SFUI-Regular\', serif;\">like old times, that is, it feels like you only spoke to them yesterday.</span><span class=\"apple-converted-space\"><span style=\"font-family: \'.SFUI-Regular\', serif;\">&nbsp;</span></span></p>\r\n<p class=\"p2\" style=\"margin: 0cm; font-size: 13pt; font-family: \'.AppleSystemUIFont\', serif; -webkit-text-size-adjust: auto;\">&nbsp;</p>\r\n<p class=\"p1\" style=\"margin: 0cm; font-size: 13pt; font-family: \'.AppleSystemUIFont\', serif; -webkit-text-size-adjust: auto;\"><span class=\"s1\" style=\"font-family: \'.SFUI-Regular\', serif;\">There are connections I could&rsquo;ve made but didn&rsquo;t. There are also connections I&rsquo;ve made and fully appreciate. The best you can do is to put yourself out there. </span></p>\r\n<p class=\"p1\" style=\"margin: 0cm; font-size: 13pt; font-family: \'.AppleSystemUIFont\', serif; -webkit-text-size-adjust: auto;\">&nbsp;</p>\r\n<p class=\"p1\" style=\"margin: 0cm; font-size: 13pt; font-family: \'.AppleSystemUIFont\', serif; -webkit-text-size-adjust: auto;\"><span class=\"s1\" style=\"font-family: \'.SFUI-Regular\', serif;\">Give yourself more opportunities and more space to meet people. These can be meet-ups. This can be singing classes. It can just be a simple work-do. Whatever it is, you&rsquo;ll be happier for it.</span><span class=\"apple-converted-space\"><span style=\"font-family: \'.SFUI-Regular\', serif;\">&nbsp;</span></span></p>\r\n<p class=\"MsoNormal\" style=\"margin: 0cm; font-size: 11pt; font-family: Calibri, sans-serif; -webkit-text-size-adjust: auto;\">&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"margin: 0cm; font-size: 11pt; font-family: Calibri, sans-serif; -webkit-text-size-adjust: auto;\">The several hikes I&rsquo;ve been doing across has allowed me to meet so many more people. From there, people invited me to football, theatres and you guessed it, even more hikes.</p>\r\n<p class=\"MsoNormal\" style=\"margin: 0cm; font-size: 11pt; font-family: Calibri, sans-serif; -webkit-text-size-adjust: auto;\">&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"margin: 0cm; font-size: 11pt; font-family: Calibri, sans-serif; -webkit-text-size-adjust: auto;\">So despite me not taking advantage of university a few years ago, in the present moment I felt I&rsquo;m using all that social media can offer to make connections.&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"margin: 0cm; font-size: 11pt; font-family: Calibri, sans-serif; -webkit-text-size-adjust: auto;\">&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"margin: 0cm; font-size: 11pt; font-family: Calibri, sans-serif; -webkit-text-size-adjust: auto;\">So if you feel like maybe there are friendships that died out, you don&rsquo;t always have to salvage it.</p>\r\n<p class=\"MsoNormal\" style=\"margin: 0cm; font-size: 11pt; font-family: Calibri, sans-serif; -webkit-text-size-adjust: auto;\">&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"margin: 0cm; font-size: 11pt; font-family: Calibri, sans-serif; -webkit-text-size-adjust: auto;\">Things can come and go. All you can do is make sure you&rsquo;re open to letting them in.</p>\r\n<p class=\"MsoNormal\" style=\"margin: 0cm; font-size: 11pt; font-family: Calibri, sans-serif; -webkit-text-size-adjust: auto;\">&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"margin: 0cm; font-size: 11pt; font-family: Calibri, sans-serif; -webkit-text-size-adjust: auto;\">Be open to change and be open to more experiences.&nbsp;</p>', NULL, 'networking-training', 'Spiela1629479769.jpeg', 'All', 1629479769, '2021-08-20 17:16:09')
